import React from 'react';
import { Container, Form, Button, Card, FloatingLabel } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './loginform.css';

const LoginForm = () => {
  return (
    <Container className="d-flex flex-column align-items-center justify-content-center" style={{ height: "100vh" }}>
      <Card style={{ width: '400px', padding: '20px', border: "none", boxShadow: "0px 0px 10px rgba(0, 0, 0, 0.1)", borderRadius: "8px" }}>
        <h4 style={{ textAlign: "center" }}>Login</h4>
        <Form className='login-form'>

          <FloatingLabel controlId="floatingEmail" label="Email address" style={{paddingBottom:"10px",width:"350px"}}>
            <Form.Control type="email" placeholder="Enter email" />
          </FloatingLabel>

          <FloatingLabel controlId="floatingPassword" label="Password" style={{paddingBottom:"10px",width:"350px"}}>
            <Form.Control type="password" placeholder="Enter Password" />
          </FloatingLabel>

          <Button variant="primary" type="submit" className='login' style={{paddingBottom:"10px",width:"350px"}}>
            LOGIN
          </Button>

          <Button variant="link" className='forgot-password'>
            Forgot Password?
          </Button>

        </Form>
      </Card>
    </Container>
  );
};

export default LoginForm;
